    const navigate = useNavigate();
    return (
        <div className={classes.catalog_card__container} onClick={() => navigate(`/${nameLink[id]}>`)}>
            <h4 className={classes.catalog_card__title}></h4>
            <img src = ""/>
        </div>
  );
}
